import React from "react";
import { Link } from "react-router-dom";
import ApiService from "../service/ApiService";

const logout = () => {
  ApiService.logout();
};

const Sidebar = () => {
  const isAuth = ApiService.isAuthenticated();
  const isAdmin = ApiService.isAdmin();
  const isMagasinier = ApiService.isMagasinier();
  const isAcheteur = ApiService.isAcheteur();

  return (
    <div className="sidebar">
      <h1 className="ims">IMS</h1>
      <ul className="nav-links">

        {isAdmin && (
          <>
            <li><Link to="/dashboard">Dashboard</Link></li>
            <li><Link to="/transaction">Transactions</Link></li>
            <li><Link to="/supplier">Supplier</Link></li>
            <li><Link to="/category">Category</Link></li>
            <li><Link to="/product">Product</Link></li>
            <li><Link to="/purchase">Purchase</Link></li>
            <li><Link to="/sell">Sell</Link></li>
            <li><Link to="/add-demande-achat">Créer Demande Achat</Link></li>
            <li><Link to="/demandes-achat">Voir Demandes Achat</Link></li>
            <li><Link to="/profile">Profile</Link></li>
          </>
        )}

        {isMagasinier && (
          <>
            <li><Link to="/dashboard">Dashboard</Link></li>
            <li><Link to="/transaction">Transactions</Link></li>
            <li><Link to="/purchase">Purchase</Link></li>
            <li><Link to="/sell">Sell</Link></li>
            <li><Link to="/add-demande-achat">Créer Demande Achat</Link></li>
            <li><Link to="/profile">Profile</Link></li>
          </>
        )}

        {isAcheteur && (
          <>
            <li><Link to="/demandes-achat">Voir Demandes Achat</Link></li>
            <li><Link to="/profile">Profile</Link></li>
          </>
        )}

        {isAuth && (
          <li>
            <Link onClick={logout} to="/login">
              Logout
            </Link>
          </li>
        )}
      </ul>
    </div>
  );
};

export default Sidebar;
